import React from "react";
import "./login.css";
import { Link } from "react-router-dom";
import "./home"
import "./signup"
import "./password"

const Login = () => {
  return (
    <div className="pagelogin">
      <div className="bglogin">
        <span className="enterlogin">LOGIN</span>
        <div className="formslogin">
        <form>
        <span className="namehead">NAME</span>
        <input type="text" className="name1head"></input><br></br>
        <span className="passwordhead">PASSWORD</span>
        <input type="password" className="password1head"></input><br></br>
        <span className="phonehead">PHONE NO</span>
        <input type="number" className="phone1head"></input><br></br>
        </form>
        </div>
        <a><Link to="/Home" className="link1login"><div className="signlogin"><button className="boxlogin">SIGN IN</button></div></Link></a>
        <div className="flex">
        <a><Link to="/Signup" className="link2login"><div><button className="box1login">Create an account!</button></div></Link></a>
        <a><Link to="/Password" className="link3login"><div><button className="box2login">Forgot password?</button></div></Link></a>
        </div>
      </div>
    </div>
  );
};
export default Login;
